import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

class Movies extends Component {
  state = {
    movies: getMovies(),
  };
  render() {
    return (
      <table className='table'>
        <thead>
          <tr>
            <th>Title</th>
            <th>Genre</th>
            <th>Stock</th>
            <th>Rate</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          <tr>{console.log(this.state.movies[1].title)}</tr>
          {this.state.movies.map((c) => console.log(c.title))}
        </tbody>
      </table>
    );
  }
}

export default Movies;
